import React from 'react'
import "./Post.style.css"
export default function Post(props) {
  return (
	<div className='post'>
		<h2 className='user'>{props.user}</h2>
		
		<h3 className='article'>{props.article}</h3>
		<span className='description'>{props.desc}</span>
	</div>
  )
}
